import React from 'react';

const SkillCard = ({ title, percent, data }) => {
  return (
    <div className="card">
      <div className="title">
        <span>
          <svg width="20" fill="currentColor" height="20" viewBox="0 0 1792 1792" xmlns="http://www.w3.org/2000/svg">
            <path d="..."></path>
          </svg>
        </span>
        <p className="title-text">{title}</p>
        <p className="percent">
          <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1792 1792" fill="currentColor" height="20" width="20">
            <path d="..."></path>
          </svg> {percent}
        </p>
      </div>
      <div className="data">
        <p>{data}</p>
        <div className="range">
          <div className="fill"></div>
        </div>
      </div>
    </div>
  );
};

export default SkillCard;
